  const [signUpData, setSignUpData] = useState({
    title: '',
    content: '',
  });
  return (
    <>
      <Form
        onSubmit={onSubmit}
        buttons={<>
          <button type="submit">
            注册
          </button>
        </>}
        fields={[
          {
            label: '标题', type: 'text', value: signUpData.username,
            onChange: e => onChange('username', e.target.value)
            , errors: errors.username
          },
        ]}>
      </Form>
    </>
  );
};

export default PostsNew;
